的出现，解决了困扰前端的两大难题：全局污染问题和依赖混乱问题，从而让精细的拆分前端工程成为了可能。\n\n工程化的出现，解决了前端开发环境和生产环境要求不一致的矛盾。在开发环境中，我们希望代码使用尽可能的细分，代码格式尽可能的统一和规范，而在生产环境中，我们希望代码尽可能的被压缩、混淆，尽可能的优化体积。工程化的出现，就是为了解决这一矛盾，它可以让我们舒服的在开发环境中书写代码，然后经过打包，生成最合适的生产环境代码，这样就解放了开发者的精力，让开发者把更多的注意力集中在开发环境上即可。\n\n组件化开发是一些前端框架带来的概念，它把一个网页，或者一个站点，甚至一个完整的产品线，划分为多个小的组件，组件是一个可以复用的单元，它包含了一个某个区域的完整功能。这样一来，前端便具备了开发复杂应用的能力。','2022-04-24 09:10:05','2022-04-24 09:10:05',NULL,-1),(239,'webpack','webpack 和 gulp 的区别是什么？','webpack 是基于模块化的构建工具，gulp 是基于工作流的构建工具。\n\nwebpack 是一个打包器，它以一个入口为起点，构建出整个项目的依赖关系图，然后进行打包合并，生成打包结果。\n\ngulp 是一个过程管理器，每一步做什么完全看开发人员如何配置，把每一个步骤连接起来形成一个完整的构建流水线。\n\n这两者并不矛盾，完全可以在一个工程中同时使用 webpack 和 gulp，将 webpack 作为 gulp 流水线中的一环。','2022-04-24 09:10:20','2022-04-24 09:10:20',NULL,-1),(240,'webpack、工程化','webpack 中的 loader 属性和 plugins 属性的区别是什么？','它们都是 webpack 功能的扩展点。\n\nloader 是加载器，主要用于代码转换，比如 JS 代码降级，CSS 预编译、模块化等\n\nplugins 是插件，webpack 打包流程中每个环节都提供了钩子函数，可以利用这些钩子函数参与到打包生命周期中，更改或增加 webpack 的某些功能，比如生成页面和 css 文件、压缩打包结果等','2022-04-24 09:10:49','2022-04-24 09:10:49',NULL,-1),(241,'模块化','commonjs 和 es6 模块的区别是什么？','CMJ 是社区标准，ESM 是官方标准\nCMJ 是使用 API 实现的模块化，ESM 是使用新语法实现的模块化\nCMJ 仅在 node 环境中支持，ESM 各种环境均支持\nCMJ 是动态的依赖，ESM 既支持动态，也支持静态\nESM 导入时有符号绑定，CMJ 只是普通函数调用和赋值','2022-04-24 09:11:00','2022-04-24 09:11:00',NULL,-1),(242,'ES6','ES6 中如何实现模块化的异步加载？','使用动态导入即可，导入后，得到的是一个 Promise，完成后，得到一个模块对象，其中包含了所有的导出结果。','2022-04-24 09:11:14','2022-04-24 09:11:14',NULL,-1),(243,'webpack','说一下 webpack 中的几种 hash 的实现原理是什么？','hash\n\nhash 是跟整个项目的构建相关，只要项目里有文件更改，整个项目构建的 hash 值都会更改，并且全部文件都共用相同的 hash 值\n\nchunkhash\n\n每个打包过程单独的 hash 值，如果一个项目有多个 entry，则每个 entry 维护自己的 chunkhash。\n\ncontenthash\n\n每个文件内容单独的 hash 值，它和打包结果文件内容有关，只要文件内容不变，contenthash 不变。','2022-04-24 09:11:32','2022-04-24 09:11:32',NULL,-1),(244,'webpack','webpack 如果使用了 hash 命名，那是每次都会重新生成 hash 吗？','不会。它跟关联的内容是否有变化有关系，如果没有变化，hash 就不会变。具体来说，contenthash 和具体的打包文件内容有关，chunkhash 和某一 entry 为起点的打包过程中涉及的内容有关，hash 和整个工程所有模块内容有关。','2022-04-24 09:11:44','2022-04-24 09:11:44',NULL,-1),(245,'webpack','webpack 中是如何处理图片的？ （抖音直播）','webpack 本身不处理图片，它会把图片内容仍然当做 JS 代码来解析，结果就是报错，打包失败。如果要处理图片，需要通过 loader 来处理。其中，url-loader 会把图片转换为 base64 编码，然后得到一个 dataurl，file-loader 则会将图片生成到打包目录中，然后得到一个资源路径。但无论是哪一种 loader，它们的核心功能，都是把图片内容转换成 JS 代码，因为只有转换成 JS 代码，webpack 才能识别。','2022-04-24 09:12:00','2022-04-24 09:12:00',NULL,-1),(246,'webpack','说一下 webpack loader 的作用是什么？','用于转换代码。有时是因为 webpack 无法识别某些内容，比如图片、css 等，需要由 loader 将其转换为 JS 代码。有时是因为某些代码需要被特殊处理，比如 JS 兼容性的处理，需要由 loader 将其进一步转换。不管是什么情况，loader 的作用只有一个，就是转换代码。','2022-04-24 09:12:24','2022-04-24 09:12:24',NULL,-1),(247,'模块化','export 和 export default 的区别是什么？\n\n','\n\nexport 为普通导出，又叫做具名导出，顾名思义，它导出的数据必须带有命名，比如变量定义、函数定义这种带有命名的语句。在导出的模块对象中，命名即为模块对象的属性名。在一个模块中可以有多个具名导出\n\nexport default 为默认导出，在模块对象中名称固定为 default，因此无须命名，通常导出一个表达式或字面量。在一个模块中只能有一个','2022-04-24 09:12:51','2022-04-24 09:12:51',NULL,-1);
